import React from 'react';
import Slider from 'react-slick';

export default function Brands({ data }) {
  const settings = {
    dots: false,
    arrows: false,
    infinite: true,
    autoplay: false,
    autoplaySpeed: 4000,
    speed: 1000,
    slidesToShow: 5,
    slidesToScroll: 1,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1400,
        settings: {
          slidesToShow: 4,
        },
      },
      {
        breakpoint: 1200,
        settings: {
          slidesToShow: 3,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 2,
        },
      },
    ],
  };

  return (
    <div className="py-3 py-md-4 brand-section gray-bg">
      <div
        className="container"
        data-aos="fade"
        data-aos-duration="1200"
        data-aos-delay="500"
      >
        <Slider {...settings} className="slider-gap-50">
          {data.map((item, index) => (
            // <div key={index}>
            //   <div className="pt-3 pb-3 text-center d-flex align-items-center justify-content-center w-100">
            //     <img src={item.src} alt={item.alt} className="w-100" />
            //   </div>
            // </div>
            <>
               <div key={index}>
                 <div className="pt-3 pb-3 text-center d-flex align-items-center justify-content-center w-100">
                   <img src={item.src} alt={item.alt} className="w-100" />
                 </div>
               </div>
              <div>
                <FontAwesomeIcon icon={faLaravel} size="4x" color="white" /></div><div><FontAwesomeIcon icon={faPhp} size="4x" color="white" /></div><div><FontAwesomeIcon icon={faHtml5} size="4x" color="white" /></div><div><FontAwesomeIcon icon={faCss3Alt} size="4x" color="white" /></div><div><FontAwesomeIcon icon={faReact} size="4x" color="white" /></div><div><FontAwesomeIcon icon={faVuejs} size="4x" color="white" /></div></>
          ))}
        </Slider>
      </div>
    </div>
  );
}
